import React, { Component } from "react";
import { Button, View, Text, StyleSheet, ScrollView } from "react-native";
//import { Calendar, CalendarList, Agenda } from "react-native-calendars";
//import { LocaleConfig } from "react-native-calendars";
import WeeklyCalendar from "react-native-weekly-calendar";

class Fitnessplan extends Component {
  constructor(props) {
    super(props);

    this.state = { courses: [] };
  }
  componentDidMount() {
    // fetch("http://192.168.0.176:9000/api/fitness")
    //fetch("http://192.168.178.23:9000/api/fitness")
    fetch("http://192.168.178.23:9000/api/fitnessevents")
      .then((response) => response.json())
      .then((data) => {
        this.setState({ courses: data });
      })
      .catch((error) => {
        throw error;
      });
  }
  componentDidMount() {
    /*var that = this;

    var date = new Date().getDate(); //Current Date

    that.setState({
      //Setting the value of the date time
      date: date,
    });*/
  }

  render() {
    const sampleEvents = [
      {
        start: "2020-08-30 09:00:00",
        duration: "160:20:00",
        note: "Walk my dog",
      },
      {
        start: "2020-08-31 09:00:00",
        duration: "01:00:00",
        note: "Doctor's appointment",
      },
      {
        start: "2020-09-01 09:00:00",
        duration: "00:30:00",
        note: "Morning exercise",
      },
      {
        start: "2020-09-02 09:00:00",
        duration: "02:00:00",
        note: "Meeting with client",
      },
      {
        start: "2020-09-03 09:00:00",
        duration: "01:00:00",
        note: "Dinner with family",
      },
      {
        start: "2020-09-04 09:00:00",
        duration: "01:00:00",
        note: "Schedule 1",
      },
      {
        start: "2020-09-05 09:00:00",
        duration: "02:00:00",
        note: "Schedule 2",
      },
      {
        start: "2020-09-06 09:00:00",
        duration: "01:30:00",
        note: "Schedule 3",
      },
      {
        start: "2020-09-07 09:00:00",
        duration: "02:00:00",
        note: "Schedule 4",
      },
      {
        start: "2020-09-08 09:00:00",
        duration: "01:00:00",
        note: "Schedule 5",
      },
    ];
    console.log(this.state.courses);
    console.log(sampleEvents);
    const courses = this.state.courses;
    return (
      <View>
        <Button
          title="Add"
          onPress={() => this.props.navigation.navigate("AddToCalendar")}
        ></Button>
        {courses.map((course) => (
          <View key={course.note} style={styles.container}>
            <WeeklyCalendar
              events={courses}
              style={{ height: 400 }}
              onDayPress={(weekday, i) => {
                console.log(
                  weekday.format("ddd") +
                    " is selected! And it is day " +
                    (i + 1) +
                    " of the week!"
                );
              }}
              startWeekday={1}
            />
          </View>
        ))}
      </View>
    );
  }
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});

export default Fitnessplan;
